import React from 'react';
import ContactStyle from './styles/contact.style.js';

const Contacts = () => {
  return (

    <div className="contact">
      <ContactStyle>
      <header className="contact-header">
        <h1>Contact Us</h1> 
      </header>
      </ContactStyle>
    </div>

  );
};

export default Contacts;
